CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_estatus_bd`(v_password VARCHAR(20))
BEGIN  

    IF v_password = "xYz$123" THEN

        (SELECT "TABLAS CATALOGO" as Tabla, "-----------------------------" AS TotalRegistros, "-----------------------------" AS TipoTabla)
        UNION
